s.x:
var $bm_rt;
var x, y;
x = thisComp.height;
$bm_rt = y = thisComp.width;
if (x > y) {
    $bm_rt = [
        y,
        y
    ];
} else {
    $bm_rt = [
        x,
        x
    ];
}
